import React from 'react';
import '../../../App.css';
import Footer from '../../Footer';
import Navbar from '../../Navbar';
import './Contact.css'

function Contact() {
  return (
    <>
      <Navbar/>
      <div class="bgc">
      <div class="contact" id="contact">

      </div>
      </div>
      <Footer/>
    </>
  );
}

export default Contact;
